import { Li } from 'react-bootstrap';

const Background = ({products}) => {

  const List = () => {
    let content = []
    for (let product of products) {
      content.push(<Li>{product.name}</Li>);
    }
    return content;
  };

  return (
    <div>
      {List}
    </div>
  );
}

export default Background;
